import React from "react";
import FormattedTime from "./FormattedTime";

export default function SunriseSunset(props) {
    return (
        <div id="sunrise-sunset">
            <div className="row">
                <div className="col-6">
                    <li><FormattedTime date={props.data.sunrise}/></li>
                </div>
            </div>
        </div>
    )
}
